import { Link } from 'react-router-dom';

function NavBar() {
    return (
        <nav className='nav'>
            <Link to="/">Homepage</Link>
            <Link to="/product/:id">ProductDetails</Link>
            <Link to="/registration">Register</Link>
            <Link to="/login">ProductDetails</Link>
        </nav>
    );
}

export default NavBar;
